  comments: string[]; // Adicione esta linha
}

const Principal: React.FC<PrincipalProps> = ({ comments }) => {
  return (
    <CommentContext>
      <div>
        <h1>Comentários na Página Principal</h1>

        {/* Renderize o componente CommentInput */}
        <CommentInput />

        {/* Renderize o componente CommentFeed */}
        <CommentFeed />
      </div>
    </CommentContext>
  );
};

export default Principal;
